import { mountSuspended } from "@nuxt/test-utils/runtime";
import { describe, expect, it } from "vitest";
import ChatMessageMedia from "./chat-message-media.vue";

describe("Chat Message Media", () => {
  it("should render the media correctly", async () => {
    const dataUrl =
      "data:image/vnd.microsoft.icon;base64,";

    const wrapper = await mountSuspended(ChatMessageMedia, {
      props: {
        isOwn: true,
        media: dataUrl
      }
    });

    expect(wrapper.find("img").exists()).toBe(true);
    expect(wrapper.find("img").attributes("src")).toBe(dataUrl);
  });
});
